import React from 'react';
import {Link} from 'react-router-dom';

import NavBar from "./NavBar";

function Home() {
    return (
        <div>
            <NavBar/>
            {/*left container*/}
            <div>
                <h1>Plover Pond Retreat</h1>
                <h2>A 3 Bedroom 3 Bathroom getaway in the heart of Georgia. Enjoy, relax, and explore.</h2>
                <Link to="/availabilities">
                    <button>Plan Your Stay</button>
                </Link>
                <Link to="/contact">
                    <button>Contact Now</button>
                </Link>
            </div>
        </div>
    );
}

export default Home
